import { Button } from "../../Shared/Buttons";
import { Modal } from "../../Shared/Modal";

export const LoginModal = ({ setLogInModalOpen }) => {
  const handleCloseModal = () => setLogInModalOpen(false);

  return (
    <Modal title='Login' setModalClose={handleCloseModal}>
      <h3>Login to save private stickers, save stickers to personal collections, and rate stickers</h3>
      <div>
        <Button>Back</Button>
        <Button>Login</Button>
      </div>
    </Modal>
  );
}
